contract BasicForwarderExecuteWrapper {
    error BadSelector();
    error BadTarget();

    uint256 someField;

    BasicForwarder public destination;
    bytes4 public aSelector;

    bytes4 selectorUsed;
    bytes4 selectorGrabbed;
    address targetUsed;

    function grabSelector(
        BasicForwarder.Request calldata request
    ) public returns (bytes4) {
        if (
            request.data.length < 4 ||
            bytes4(request.data[:4]) != this.doStuff.selector
        ) {
            revert BadSelector();
        }
        if (request.target != address(this)) {
            revert BadTarget();
        }
        selectorGrabbed = bytes4(request.data[:4]);
        return selectorGrabbed;
    }

    function executeWrapper(
        BasicForwarder.Request calldata request,
        bytes calldata signature
    ) public payable returns (bool success) {
        if (
            request.data.length < 4 ||
            bytes4(request.data[:4]) != this.doStuff.selector
        ) {
            revert BadSelector();
        }
        if (request.target != address(this)) {
            revert BadTarget();
        }
        selectorUsed = bytes4(request.data[:4]);
        targetUsed = request.target;

        return destination.execute(request, signature);
    }

    function tst(
        BasicForwarder.Request calldata request,
        bytes calldata signature,
        bytes4 expectedSelector
    ) public payable returns (bool success) {
        if (
            request.data.length < 4 ||
            bytes4(request.data[:4]) != this.doStuff.selector
        ) {
            revert BadSelector();
        }
        if (request.target != address(this)) {
            revert BadTarget();
        }
        return doStuff() > 0;
    }

    function doStuff() public returns (uint256) {
        someField += 1;
        return someField;
    }
}

